// DashboardTable.js
import React, { useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, TextField, IconButton } from '@mui/material';
import AddCircleOutlineIcon from '@mui/icons-material/AddCircleOutline';
import ActionBar from './ActionBar'; // Ensure this import path is correct
import { getFileIcon } from './utils'; // Ensure this import path is correct

const DashboardTable = () => {
  const [students, setStudents] = useState([
    { name: 'Claire Johnson', submissions: [{ fileName: 'PM_feedback.pdf', submittedOn: new Date() }], grade: '', comments: '' }
    // ... add more initial student data here if necessary
  ]);

  const handleNewSubmission = (newSubmission, index) => {
    const updatedStudents = [...students];
    updatedStudents[index].submissions = [
      ...updatedStudents[index].submissions,
      newSubmission
    ];
    setStudents(updatedStudents);
  };

  const addNewRow = () => {
    setStudents([...students, { name: '', submissions: [], grade: '', comments: '' }]);
  };

  return (
    <Paper>
      <TableContainer>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>Name</TableCell>
              <TableCell>Submission</TableCell>
              <TableCell>Date</TableCell>
              <TableCell>Grade</TableCell>
              <TableCell>Comments</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {students.map((student, index) => (
              <React.Fragment key={index}>
                <TableRow>
                  <TableCell>
                    <TextField
                      fullWidth
                      value={student.name}
                      onChange={(e) => {
                        const updatedStudents = [...students];
                        updatedStudents[index].name = e.target.value;
                        setStudents(updatedStudents);
                      }}
                      placeholder="Enter name"
                    />
                  </TableCell>
                  <TableCell>
                    {student.submissions.map((submission, subIndex) => (
                      <div key={subIndex} style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
                        {getFileIcon(submission.fileName)}
                        <span>{submission.fileName}</span>
                      </div>
                    ))}
                  </TableCell>
                  <TableCell>
                    {student.submissions.map((submission, subIndex) => (
                      <span key={subIndex}>{submission.submittedOn.toLocaleDateString()}</span>
                    ))}
                  </TableCell>
                  <TableCell>
                    <TextField
                      fullWidth
                      value={student.grade}
                      onChange={(e) => {
                        const updatedStudents = [...students];
                        updatedStudents[index].grade = e.target.value;
                        setStudents(updatedStudents);
                      }}
                      placeholder="Enter grade"
                    />
                  </TableCell>
                  <TableCell>
                    <TextField
                      fullWidth
                      value={student.comments}
                      onChange={(e) => {
                        const updatedStudents = [...students];
                        updatedStudents[index].comments = e.target.value;
                        setStudents(updatedStudents);
                      }}
                      placeholder="Enter comments"
                    />
                  </TableCell>
                </TableRow>
                <TableRow style={{ borderTop: 'none' }}>
                  <TableCell colSpan={5}>
                    <ActionBar 
                      onFileUpload={(event) => {
                        const file = event.target.files[0];
                        if (file) {
                          handleNewSubmission({
                            fileName: file.name,
                            submittedOn: new Date(),
                          }, index);
                        }
                        event.target.value = ''; // reset the file input
                      }}
                    />
                  </TableCell>
                </TableRow>
                {index < students.length - 1 && (
                  <TableRow>
                    <TableCell style={{ padding: '8px 0' }} colSpan={5}></TableCell>
                  </TableRow>
                )}
              </React.Fragment>
            ))}
            <TableRow>
              <TableCell colSpan={5} style={{ textAlign: 'center' }}>
                <IconButton onClick={addNewRow}>
                  <AddCircleOutlineIcon />
                </IconButton>
              </TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};

export default DashboardTable;
